import react , {useEffect , useState} from "react";
import { useParams } from "react-router";

const FiveDayForecast = (props) => {

    const [data,setData] = useState(null);
    const params = useParams();

    console.log(params.cityId);

    const fetchData = ( async () => {
        const response = await fetch(`https://api.openweathermap.org/data/2.5/forecast?q=${params.cityId}&units=metric&appid=5a4e05662564bdefbc9d1b3d65c255f0`);
        const data = await response.json();
        setData(data);
        console.log(data); 
    });

    useEffect(() => {
        fetchData();
    }, []);


    return(
        <div>
            <div>Ovo je petodnevna prognoza</div>
            {data && <p>{data.list.weather.icon}</p>}
        </div>
    );
}

export default FiveDayForecast;
